    <div style=""position:absolute;left:450px;top:3620px"">
        Green Lantern es un nombre que ha sido usado por muchos personajes en el Universo DC y dos franquicias distintas. El original durante la Edad de Oro fue el hombre de negocios Alan Scott , que llevaba un anillo de poder mágicoque creaba construcciones de energía y tenía que cargarse con su linterna mística. "" Green L");
                WriteLiteral(@"antern "" se volvió a imaginar en la Edad de Plata como piloto de prueba Hal Jordan , miembro de una fuerza intergaláctica de mantenimiento de la paz llamada Green Lantern Corps .
        Los Guardianes del Universo en Oa dan estos anillos de Faroles controlados por fuerza de voluntad, y enviarlos a patrullar los 3600 sectores del universo conocido. Se dijo que Jordan era miembro de la Liga de la Justicia en la Tierra-Uno , y se decía que Scott era miembro de la Sociedad de la Justicia en la Tierra-Dos . Sus líneas de tiempo se fusionaron durante la Crisis en las Tierras Infinitas , y se explicó que el anillo mágico de Scott se conecta con el Corazón Estelar . Ha habido varios otros Linternas Verdes humanas del Sector 2814 .
        El descarado Guy Gardner y más tarde el arquitecto John Stewart fueron presentados originalmente como sustitutos de Jordan. Kyle Raynerse convirtió en el quinto y único Linterna Verde cuando Jordan se convirtió en el malvado Parallax y destruyó el Cuerpo durante el Crepúsculo Esm");
                WriteLiteral(@"eralda . El Cuerpo desde entonces ha sido reconstruido con todos los Faroles sirviendo simultáneamente. El ingeniero musulmán Simon Baz se convertiría en el sexto. La víctima del PTSD, Jessica Cruz, se convirtió en la séptima después de heredar el Anillo de Volthoom de Power Ring of the Crime Syndicate .
        La versión de Alan Scott de Green Lantern fue creada por Bill Finger y Martin Nodell, apareciendo por primera vez en All-American Comics # 16 . ( 1940 ) La versión de Hal Jordan fue creada por John Broome y Gil Kane después de un concepto inicial de Julius Schwartz , apareciendo por primera vez en Showcase # 22 . ( 1959 )
